');
INSERT INTO `sys_wechat_news` VALUES ('459', '习近平主持召开中央全面深化改革领导小组会议', 'ww2E5UxkP8-vK-_cBZQKl3L7XxUirjojBqCyFpAIjXs', '1', 'Spiderman', '视野顺便', '中共中央总书记、国家主席、中央军委主席、中央全面深化改革领导小组组长习近平7月19日下午主持召开中央全面深化改革领导小组第三十七次会议并发表重要讲话。他强调，各地区要切实把思想和行动统一到党中央改革决策部署上来，从服务党和国家工作大局出发推动改革，敢于担当、善谋实干、实事求是、锐意进取，扎实推进各项改革落到实处、见到实效。  　　中共中央政治局常委、中央全面深化改革领导小组副组长李克强、刘云山、张高丽出席会议。  　　会议审议通过了《关于创新体制机制推进农业绿色发展的意见》、《国家技术转移体系建设方案》、《关于深入推进公共文化机构法人治理结构改革的实施方案》、《关于加强和改进中外人文交流工作的若干意见》、《聘任制公务员管理规定（试行）》、《关于完善进出口商品质量安全风险预警和快速反应监管体系切实保护消费者权益的意见》、《关于深化审评审批制度改革鼓励药品医疗器械创新的意见》、《建立国家公园体制总体方案》、《关于健全统一司法鉴定管理体制的实施意见》。会议审议了《党的十八届三中全会以来改革试点工作进展情况报告》、《关于社会保障制度改革督察情况报告》。  　　会议指出，推进农业绿色发展是农业发展观的一场深刻革命，也是农业供给侧结构性改革的主攻方向。要正确处理农业绿色发展和生态环境保护、粮食安全、农民增收的关系，创新有利于增加绿色优质农产品供给、降低资源环境利用强度、促进农民就业增收的体制机制，形成同环境资源承载能力相匹配、生产生活生态相协调的农业发展格局，实现农业可持续发展。  　　会议强调，建立和完善国家技术转移体系，要聚焦影响长远发展的战略必争领域，遵循技术转移规律，发挥市场机制作用，加强技术供需对接，打通科技转化通道，强化联动协同，加快推动重大科技成果转化应用，更好发挥技术转移对提升科技创新能力、促进经济社会发展的重要作用。', '', 'http://news.sina.com.cn/o/2017-07-19/doc-ifyihmmm7596547.shtml', null, '1', '107');
INSERT INTO `sys_wechat_news` VALUES ('460', '李克强主持召开国务院常务会议', 'ww2E5UxkP8-vK-_cBZQKlzU8Da3qFq1sJtnTcEn5Ths', '1', 'Spiderman', '无可奈何花落去', '会议指出，创建“中国制造2025”国家级示范区，探索实体经济尤其是制造业转型升级新突破，有利于推进供给侧结构性改革，建设制造强国，推动经济实现“双中高”。会议强调，在东中西部选择部分城市或城市群建设国家级示范区，要聚焦创新体制机制，与“互联网+”“双创”结合，破解制造业发展瓶颈。实施国家自主创新示范区等的有关政策，对内外资一视同仁。一是深化“放管服”改革，加快工业生产许可准入制度改革，出台制造业准入负面清单。二是为大中小企业融通、集群发展搭建平台，用好政府资金，带动社会资本支持先进制造。国有商业银行已成立的普惠金融事业部要着力在示范区探索经验。三是支持利用老旧工商设施发展生产性服务业。四是鼓励对符合条件的高校毕业生等给予创业补贴。推广海外人才优惠便利政策。五是深化中外合作，积极引进国外先进技术。  　　为防控义务教育学生失学辍学，实现2020年九年义务教育巩固率目标，会议要求优化教育支出结构，强化义务教育投入，提高教育质量，做到“三避免、一落实”：一是避免因贫失学辍学，落实教育扶贫和资助政策，优先资助残疾学生和残疾人子女。二是避免因上学远上学难而辍学，加强寄宿制学校建设，在交通不便的地方适当保留或设置教学点。通过信息化使农村获得更多优质教育资源。三是避免因厌学而辍学，改善农村办学条件，帮扶学习困难学生。四是落实控辍保学责任。对父母或监护人无正当理由未送适龄少儿入学的，政府要责令改正。学校要做好辍学学生劝返复学工作。', '', 'http://news.sina.com.cn/c/2017-07-19/doc-ifyihrwk1362777.shtml', null, '2', '107');
INSERT INTO `sys_wechat_news` VALUES ('461', '深圳最美公园香蜜公园昨开园 拥有一片良种荔枝林', 'ww2E5UxkP8-vK-_cBZQKl5WgZQJkX7kIhIWpNqvYI-A', '1', 'Spiderman', '魂牵梦绕', '深圳晚报讯（记者 汪仕林 王博 通讯员 温现青 朱晓琳）19日上午，有“深圳最美公园”“风水宝地”“都市绿肺”美称的香蜜公园上午揭开美丽的面纱正式开园迎宾，深圳市委常委刘庆生、市城管局局长王国宾、福田区委书记肖亚非、区长高圣元和公园建设者、市民一起共同见证香蜜公园开园仪式，区领导现场把象征守护人角色的金钥匙交到公园理事会手中。下一步还将把福田区婚姻登记处搬迁进公园，预示着人生甜蜜幸福的生活将如同清澈的湖水一样浪漫而诗意。与香蜜公园相配套的香蜜体育中心此前已经向市民开放。香蜜公园全面对外开放，是福田中心区向即将在深圳举行的第十九届国际植物学大会献上一份厚礼。  　　香蜜公园是市区两级民生工程，也是深圳海绵城市建设的重要项目，之前是一块业态复杂、环境脏杂乱的农业用地，经过历时两年精雕细琢，转变成一个集生态、休闲、婚庆、阅读于一体的综合性大型市政公园。走进公园大门，迎面是360米长的椰林大道，一派南国风光。公园拥有10多万平方米的良种荔枝林，占总面积的40%，荔枝林的原有生态风貌都得到了保留。在婚姻登记处附近规划建设了玫瑰主题花园和中西式的婚礼主题建筑。站在8.8米高的中部栈道上，整片荔枝林和公园美景尽收眼底，向远处眺望，不远处便是城市具有标志性的平安大厦、招商银行大厦等建筑。置身浓密葱郁的荔枝林，远眺不远处的都市，田园风光与都市文明交相辉映，在这里，留得住“乡愁”，更能看得到远方。', '', 'http://shenzhen.sina.com.cn/news/2017-07-20/detail-ifyihrmf2827966.shtml', null, '3', '107');
