  `next_lb_days` int(11) DEFAULT NULL COMMENT '离下次农历生日天数',
  `next_sb_days` int(11) DEFAULT NULL COMMENT '离下次公历生日天数',
  `advance_date_count` varchar(50) DEFAULT NULL COMMENT '提前提醒天数',
  `token` varchar(255) DEFAULT NULL,
  `alipayname` varchar(255) DEFAULT NULL,
  `openid` varchar(255) DEFAULT NULL COMMENT '微信用户oppenid',
  `gold_beans` varchar(32) DEFAULT NULL COMMENT '金豆',
