DROP TABLE IF EXISTS `lsh_goods`;
CREATE TABLE `lsh_goods` (
  `goods_id` int(11) NOT NULL AUTO_INCREMENT,
  `goodstype_id` int(11) DEFAULT NULL COMMENT '商品类目',
  `goods_name` varchar(255) DEFAULT NULL COMMENT '商品名称',
  `original_price` decimal(8,2) DEFAULT NULL COMMENT '原价',
  `current_price` decimal(8,2) DEFAULT NULL COMMENT '现价',
  `discount` decimal(8,2) DEFAULT NULL COMMENT '折扣',
  `deduction_money` decimal(8,2) DEFAULT NULL COMMENT '礼豆抵扣金额',
  `goods_position` int(11) DEFAULT NULL COMMENT '0普通商品,1积分商品,2生日那天免费送蛋糕商品,3抽奖商品,4为代理商礼包、5为VIP礼包、6为合伙人礼包、7为付费会员礼包',
  `integration` int(11) DEFAULT NULL COMMENT '所需礼豆',
  `picture_id` varchar(255) DEFAULT NULL COMMENT '商品小图',
  `index_broadcast` varchar(255) DEFAULT NULL COMMENT '商品首页轮播图',
  `sales_volume` int(11) DEFAULT '0' COMMENT '销量',
  `goods_details` text COMMENT '商品详情',
  `seqence` int(11) DEFAULT NULL COMMENT '排序',
  `create_date` varchar(255) DEFAULT NULL COMMENT '创建时间',
  `create_user` varchar(255) DEFAULT NULL COMMENT '创建人',
  `update_date` varchar(255) DEFAULT NULL COMMENT '修改时间',
  `update_user` varchar(255) DEFAULT NULL COMMENT '修改人',
  `delete_status` int(11) DEFAULT NULL COMMENT '删除状态,0为未删除,1为删除',
  `is_broadcast` int(1) DEFAULT '0' COMMENT '0为不轮播，1为轮播',
  `favorite_number` int(11) DEFAULT '0' COMMENT '商品收藏数量',
  `is_index` int(1) DEFAULT '1' COMMENT '0为不在首页展示，1为首页展示',
  PRIMARY KEY (`goods_id`),
  KEY `FK_Reference_16` (`goodstype_id`),
  KEY `idx_goods_position` (`goods_position`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=40 DEFAULT CHARSET=utf8;

