DROP TABLE IF EXISTS `sys_wechat_mass`;
CREATE TABLE `sys_wechat_mass` (
  `wechat_mass_id` int(11) NOT NULL AUTO_INCREMENT,
  `msgtype` varchar(255) DEFAULT NULL COMMENT '群发的消息类型，图文消息为mpnews，文本消息为text，语音为voice，音乐为music，图片为image，视频为mpvideo，卡券为wxcard',
  `status` varchar(255) DEFAULT NULL COMMENT '-1发送失败，0,发送成功，1为接收成功，2接收失败',
  `media_id` varchar(255) DEFAULT NULL COMMENT '用于群发的消息的media_id',
  `tag_id` int(11) DEFAULT NULL COMMENT '群发到的标签的tag_id，参加用户管理中用户分组接口，若is_to_all值为true，可不填写tag_id',
  `is_to_all` varchar(255) DEFAULT NULL COMMENT '用于设定是否向全部用户发送，值为true或false，选择true该消息群发给所有用户，选择false可根据tag_id发送给指定群组的用户',
  `title` varchar(255) DEFAULT NULL COMMENT '消息的标题',
  `description` varchar(255) DEFAULT NULL COMMENT '消息的描述',
  `send_ignore_reprint` varchar(255) DEFAULT NULL COMMENT '图文消息被判定为转载时，是否继续群发。',
  `msg_id` varchar(255) DEFAULT NULL COMMENT '消息发送任务的ID',
  `msg_data_id` varchar(255) DEFAULT NULL COMMENT '	消息的数据ID，该字段只有在群发图文消息时，才会出现。可以用于在图文分析数据接口中，获取到对应的图文消息的数据，是图文分析数据接口中的msgid字段中的前半部分，详见图文分析数据接口中的msgid字段的介绍。',
  `textcontent` text COMMENT '文本消息内容',
  `openidlist` text,
  `errmsg` varchar(555) DEFAULT NULL COMMENT '错误信息',
  PRIMARY KEY (`wechat_mass_id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of sys_wechat_mass
-- ----------------------------

